var SITE = {
    init: function() {
        console.log("Updated to include: 1 Guide Matching 2 JSON Animation upgrade");

        var myElement = document.getElementById("border");

        myElement.addEventListener("click", function() {
            // Enabler.exit('Background Exit');
            window.open(clickTag);
        });

        // Load Lottie animation
        SITE.loadLottie();
        SITE.loadLottie2();
        SITE.cta1Hover();

        // Call the animate function
        TweenLite.delayedCall(0, SITE.animate);

    },

    loadLottie: function() {
        SITE.lottieAnim = lottie.loadAnimation({
            container: document.getElementById('lottie-container'),
            renderer: 'canvas',
            loop: false,
            autoplay: false,
            animationData: jsonAnim // Update with your JSON path
        });
    },

    playLottie: function() {
        if (SITE.lottieAnim) {
            const lottieContainer = document.getElementById("lottie-container");
            lottieContainer.style.opacity = "1";
            SITE.lottieAnim.goToAndPlay(0, true);
        }
    }, 

    loadLottie2: function() {
        SITE.lottieAnim2 = lottie.loadAnimation({
            container: document.getElementById('lottie-container-2'),
            renderer: 'svg',
            loop: false,
            autoplay: false,
            animationData: jsonAnim2 // Update with your JSON path
        });
    },

    playLottie2: function() {
        if (SITE.lottieAnim2) {
            const lottieContainer2 = document.getElementById("lottie-container-2");
            lottieContainer2.style.opacity = "1";
            SITE.lottieAnim2.goToAndPlay(0, true);
        }
    },       
  
    cta1Hover: function () {
	  const container = document.getElementById("border");
	  const cta1 = document.getElementById("cta1");
	  const cta1_hover = document.getElementById("cta1_hover");

	  container.addEventListener("mouseenter", function () {
	    cta1.style.display = "none";
	    cta1_hover.style.display = "block";
	  });

	  container.addEventListener("mouseleave", function () {
	    cta1.style.display = "block";
	    cta1_hover.style.display = "none";
  });
},

cta2Hover: function () {
  const container = document.getElementById("border");
  const cta2 = document.getElementById("cta2");
  const cta2_hover = document.getElementById("cta2_hover");

  container.addEventListener("mouseenter", function () {
    cta2.style.display = "none";
    cta2_hover.style.display = "block";
  });

  container.addEventListener("mouseleave", function () {
    cta2.style.display = "block";
    cta2_hover.style.display = "none";
  });
},

    bgScale: function() {
       TweenLite.to("#img1", 10, { scale:1});
    },

    animate: function() {

        //cta animation
        // const container = document.getElementById('border');
        const cta3 = document.getElementById('cta3');
        const cta4 = document.getElementById('cta4');

        // 
        const pulseSpeed = 0.25;
        const pulseScale = 1.15;
        const pulseScale2 = 1.05;

        // Initial element position settings
        TweenLite.set(".c1", { x: -3 });
        TweenLite.set(".c2", { x: -3 });
        TweenLite.set("#logo1", { x: 55 });
        TweenLite.set("#logo2", { x: -84 });
        TweenLite.set("#logo3", {y:39, x: 140 });
        TweenLite.set("#logo4", {y:39,  x: 160 });
        TweenLite.set("#logo_mask", { x: 90 });
        TweenLite.set("#img1", { scale:1.25});

        

        const copyDur = 0.2;
        const copyDel = "+=0";
        const copyDelPlus = "+=0.05";
        const copyDelGap = "+=0.2"
        const copyDelGapPlus = "+=0.35"
        
        // Create a GSAP timeline
        const timeline = new TimelineMax({repeat: 0, repeatDelay: 2});

        // Set #container to be visible
        timeline.to(["#container"], 0, {autoAlpha: 1}, "+=0")
        .call(SITE.bgScale, null, "+=0") 
        .call(SITE.playLottie, null, "+=0") // Play Lottie animation here

// Frame 1
		.to("#c1_01", 0, { autoAlpha: 1 }, "+=1.5")
		.to("#c1_01", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c1_02", 0, { autoAlpha: 1 }, copyDelPlus)
		.to("#c1_02", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c1_03", 0, { autoAlpha: 1 }, copyDelPlus)
		.to("#c1_03", copyDur, { x: 0, ease: Power1.easeOut })





        .to(["#cta1","#cta1_hover"], pulseSpeed, {z:0.01, scale:pulseScale, autoAlpha:1, ease:Power2.easeOut, transformOrigin:"70px 215px", onStart:SITE.cta1Hover}, "+=0.4" )
        .to(["#cta1","#cta1_hover"], pulseSpeed*2.5, {z:0.01, scale:1, autoAlpha:1, ease:Power1.easeOut, transformOrigin:"70px 215px"}, "+=0.1" )

        .to(".c1", 0, { autoAlpha:0, ease: Power1.easeOut },"=+1.3")

        //Frame 2
		.to("#c2_01", 0, { autoAlpha: 1 }, copyDel)
		.to("#c2_01", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_02", 0, { autoAlpha: 1 }, copyDel)
		.to("#c2_02", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_03", 0, { autoAlpha: 1 }, copyDel)
		.to("#c2_03", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_04", 0, { autoAlpha: 1 }, copyDel)
		.to("#c2_04", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_05", 0, { autoAlpha: 1 }, copyDelGap)
		.to("#c2_05", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_06", 0, { autoAlpha: 1 }, copyDel)
		.to("#c2_06", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_07", 0, { autoAlpha: 1 }, copyDelGap)
		.to("#c2_07", copyDur, { x: 0, ease: Power1.easeOut })

		.to("#c2_08", 0, { autoAlpha: 1 }, copyDelGapPlus)
		.to("#c2_08", copyDur, { x: 0, ease: Power1.easeOut })


		//.to(["#tac"], 0.3, { autoAlpha: 1, ease: Power1.easeOut })
        

        .to(["#cta1","#cta1_hover"], pulseSpeed, {z:0.01, scale:0.9, autoAlpha:1, ease:Power2.easeOut, transformOrigin:"70px 215px"}, "+=0.5" )
        .to(["#cta1","#cta1_hover"], pulseSpeed, {z:0.01, scale:pulseScale2, autoAlpha:1, ease:Power2.easeOut, transformOrigin:"70px 215px"}, "+=0" )
        .to(["#cta1","#cta1_hover"], pulseSpeed*1.5, {z:0.01, scale:1, autoAlpha:1, ease:Power1.easeOut, transformOrigin:"70px 215px"}, "+=0" )

        // .set(["#cta2"], {display: "block"})
        .to(["#bg3", "#cta2", "#cta2_hover"], 0, {x: 0, y: 0, autoAlpha: 1, ease: Power1.easeOut, onComplete:SITE.cta2Hover}, "+=2.2") //this changed from 1.6 to 2.2
        .to(["#lottie-container","#cta1","#cta1_hover"], 0, { autoAlpha:0, ease: Power1.easeOut },"=+0")

        .call(SITE.playLottie2, null, "+=0") // Play Lottie animation here
        ;

        timeline.play();
        // timeline.pause(2);
        // document.getElementById('guide').style.backgroundImage = "url('1.jpg')";
        // timeline.pause(11.35);
        console.log("Animation length: ", timeline.duration(),"Total length if End Lottie included: ", (timeline.repeat() + 1)*timeline.duration()+2.4);

    }
};

